"place": -1,
"text": "<div>\n<i class=\"NoteType\">\n\u0417\u0430\u043c\u0435\u0442\u043a\u0430 \u043e \u0441\u043e\u0431\u044b\u0442\u0438\u0438\n</i>\n<div class=\"grampsstylednote\">\n<p>\n\u0422\u0430\u043a \u043a\u0430\u043a \u0432 \u0441\u0432\u0438\u0434\u0435\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0435 \u043e \u0440\u043e\u0436\u0434\u0435\u043d\u0438\u0438 \u043d\u0430\u043f\u0438\u0441\u0430\u043d\u043e, \u0447\u0442\u043e \u0422\u0438\u043c\u043e\u0444\u0435\u0439 \u041d\u0438\u043a\u0430\u043d\u043e\u0440\u043e\u0432\u0438\u0447 \u0443\u043c\u0435\u0440 6 \u043c\u0430\u0440\u0442\u0430 1941 \u0433. \u0432 \u0432\u043e\u0437\u0440\u0430\u0441\u0442\u0435 60 \u043b\u0435\u0442, \u0442\u043e \u0441 \u0431\u043e\u043b\u044c\u0448\u043e\u0439 \u0434\u043e\u043b\u0435\u0439 \u0432\u0435\u0440\u043e\u044f\u0442\u043d\u043e\u0441\u0442\u0438 61 \u0433\u043e\u0434 \u0432 1941-\u043c \u043a\u0430\u043b\u0435\u043d\u0434\u0430\u0440\u043d\u043e\u043c \u0433\u043e\u0434\u0443 \u0435\u043c\u0443 \u0435\u0449\u0435 \u043d\u0435 \u0438\u0441\u043f\u043e\u043b\u043d\u0438\u043b\u0441\u044f, \u043f\u043e\u044d\u0442\u043e\u043c\u0443 \u043f\u0440\u0438\u043d\u044f\u0442\u043e \u0441\u0447\u0438\u0442\u0430\u0442\u044c, \u0447\u0442\u043e \u0434\u0430\u0442\u0430 \u0435\u0433\u043e \u0440\u043e\u0436\u0434\u0435\u043d\u0438\u044f - 1880 \u0433. \u0422\u0430\u043a \u0436\u0435 \u043c\u043e\u0436\u043d\u043e \u0432\u044b\u0441\u0447\u0438\u0442\u0430\u0442\u044c \u0438 \u043e\u0442\u043d\u043e\u0441\u0438\u0442\u0435\u043b\u044c\u043d\u043e \u0441\u0432\u0435\u0434\u0435\u043d\u0438\u0439 \u043e \u0431\u0440\u0430\u043a\u0435 \u0438\u0437 \u041c\u0435\u0442\u0440\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u043a\u043d\u0438\u0433\u0438 \u0437\u0430 1901 \u0433\u043e\u0434, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u0441\u043a\u0430\u0437\u0430\u043d\u043e, \u0447\u0442\u043e \u043d\u0430 2 \u0444\u0435\u0432\u0440\u0430\u043b\u044f \u0422\u0438\u043c\u043e\u0444\u0435\u044e \u041d\u0438\u043a\u0430\u043d\u043e\u0440\u043e\u0432\u0438\u0447\u0443 \u0431\u044b\u043b\u043e 20 \u043b\u0435\u0442.\n</p>\n</div>\n<i class=\"NoteType\">\n\u0417\u0430\u043c\u0435\u0442\u043a\u0430 \u043e \u0441\u043e\u0431\u044b\u0442\u0438\u0438\n</i>\n<div class=\"grampsstylednote\">\n<p>\n\u0413\u041a\u0423 \u0426\u0410\u041d\u041e \u0432 \u0437\u0430\u043f\u0440\u043e\u0441\u0435 \u043e \u043f\u0440\u0435\u0434\u043e\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u0438\u0438 \u0441\u043f\u0440\u0430\u0432\u043a\u0438 \u043e \u0440\u043e\u0436\u0434\u0435\u043d\u0438\u0438 \u0441\u043e\u043e\u0431\u0449\u0438\u043b \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0435\u0435: \"\u0421\u043e\u043e\u0431\u0449\u0430\u0435\u043c, \u0447\u0442\u043e \u0432 \u0434\u043e\u043a\u0443\u043c\u0435\u043d\u0442\u0430\u0445 \u0430\u0440\u0445\u0438\u0432\u043d\u043e\u0433\u043e \u0444\u043e\u043d\u0434\u0430 \u0412\u044f\u0442\u0441\u043a\u043e\u0439 \u0434\u0443\u0445\u043e\u0432\u043d\u043e\u0439 \u043a\u043e\u043d\u0441\u0438\u0441\u0442\u043e\u0440\u0438\u0438, \u0432 \u043c\u0435\u0442\u0440\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u043a\u043d\u0438\u0433\u0430\u0445 \u0446\u0435\u0440\u043a\u0432\u0438 \u0441\u0435\u043b\u0430 \u0428\u0430\u0440\u0430\u043d\u0433\u0430 (\u043f\u0440\u0438\u0445\u043e\u0434 \u043f\u043e\u0447\u0438\u043d\u043a\u0430 \u041c\u043e\u0441\u0443\u043d\u043e\u0432\u043e) \u042f\u0440\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u0443\u0435\u0437\u0434\u0430 \u0412\u044f\u0442\u0441\u043a\u043e\u0439 \u0433\u0443\u0431\u0435\u0440\u043d\u0438\u0438 \u0437\u0430 1879-1883 \u0433\u0433., \u0441\u0432\u0435\u0434\u0435\u043d\u0438\u0439 \u043e \u0440\u043e\u0436\u0434\u0435\u043d\u0438\u0438 \u0414\u043e\u043c\u0440\u0430\u0447\u0435\u0432\u0430 \u0422\u0438\u043c\u043e\u0444\u0435\u044f \u041d\u0438\u043a\u0430\u043d\u043e\u0440\u043e\u0432\u0438\u0447\u0430 \u043d\u0435 \u043e\u0431\u043d\u0430\u0440\u0443\u0436\u043d\u043e\". \u0418\u0437 \u044d\u0442\u043e\u0433\u043e \u043e\u0442\u0432\u0435\u0442\u0430 \u043c\u043e\u0436\u043d\u043e \u0441\u0434\u0435\u043b\u0430\u0442\u044c \u0432\u044b\u0432\u043e\u0434\u044b, \u0447\u0442\u043e, \u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e, \u0422\u0438\u043c\u043e\u0444\u0435\u0439 \u041d\u0438\u043a\u0430\u043d\u043e\u0440\u043e\u0432\u0438\u0447 \u0440\u043e\u0434\u0438\u043b\u0441\u044f \u043d\u0435 \u0432 \u0441\u0435\u043b\u0435 \u043f\u0440\u0438\u0445\u043e\u0434\u0430 \u0428\u0430\u0440\u0430\u043d\u0433\u0441\u043a\u043e\u0439 \u0446\u0435\u0440\u043a\u0432\u0438, \u0430 \u0432 \u041c\u043e\u0441\u0443\u043d\u043e\u0432\u043e \u043f\u0435\u0440\u0435\u0435\u0445\u0430\u043b \u043f\u043e\u0437\u0436\u0435.\n</p>\n</div>\n</div>",
