"text": "<div>\n<i class=\"NoteType\">\n\u0417\u0430\u043c\u0435\u0442\u043a\u0430 \u043e \u0441\u043e\u0431\u044b\u0442\u0438\u0438\n</i>\n<div class=\"grampsstylednote\">\n<p>\n\u041e\u0442\u0434\u0435\u043b \u0417\u0410\u0413\u0421 \u043f\u043e \u0433. \u0412\u043e\u043b\u044c\u0441\u043a\u0443 \u0438 \u0412\u043e\u043b\u044c\u0441\u043a\u043e\u043c\u0443 \u0440\u0430\u0439\u043e\u043d\u0443<br />\nvolsk@saratovzags.ru<br />\n31 \u043e\u043a\u0442\u044f\u0431\u0440\u044f, 13:11\n</p>\n<p>\n\u0414\u043e\u0431\u0440\u044b\u0439 \u0434\u0435\u043d\u044c! \u041d\u0430 \u0412\u0430\u0448 \u0437\u0430\u043f\u0440\u043e\u0441 \u0441\u043e\u043e\u0431\u0449\u0430\u0435\u043c, \u0447\u0442\u043e \u0432 \u0430\u0440\u0445\u0438\u0432\u0435 \u043e\u0442\u0434\u0435\u043b\u0430 \u0417\u0410\u0413\u0421 \u043f\u043e \u0433. \u0412\u043e\u043b\u044c\u0441\u043a\u0443 \u0438 \u0412\u043e\u043b\u044c\u0441\u043a\u043e\u043c\u0443 \u0440\u0430\u0439\u043e\u043d\u0443 \u0438\u043c\u0435\u0435\u0442\u0441\u044f \u0437\u0430\u043f\u0438\u0441\u044c \u0430\u043a\u0442\u0430 \u043e \u0441\u043c\u0435\u0440\u0442\u0438 \u2116 7 \u043e\u0442 05.06.1964 \u0433\u043e\u0434\u0430 \u043d\u0430 \u041d\u0430\u0437\u0430\u0440\u043e\u0432\u0443 \u0422\u0430\u0442\u044c\u044f\u043d\u0443 \u0410\u043b\u0435\u043a\u0441\u0435\u0435\u0432\u043d\u0443, \u0441\u043e\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u043d\u0443\u044e \u041a\u0443\u043b\u0438\u043a\u043e\u0432\u0441\u043a\u0438\u043c \u0441\u0435\u043b\u044c\u0441\u043a\u0438\u043c \u0421\u043e\u0432\u0435\u0442\u043e\u043c \u0412\u043e\u043b\u044c\u0441\u043a\u043e\u0433\u043e \u0440\u0430\u0439\u043e\u043d\u0430 \u0421\u0430\u0440\u0430\u0442\u043e\u0432\u0441\u043a\u043e\u0439 \u043e\u0431\u043b\u0430\u0441\u0442\u0438. \u041d\u0430 \u041d\u0430\u0437\u0430\u0440\u043e\u0432\u0430 \u0415\u0444\u0438\u043c\u0430 \u0414\u043c\u0438\u0442\u0440\u0438\u0435\u0432\u0438\u0447\u0430, \u042e\u0440\u0437\u0430\u043d\u043e\u0432\u0430 \u0424\u0435\u0434\u043e\u0440\u0430 \u041c\u0430\u043a\u0441\u0438\u043c\u043e\u0432\u0438\u0447\u0430 \u0438 \u042e\u0440\u0437\u0430\u043d\u043e\u0432\u0443 \u0422\u0430\u0442\u044c\u044f\u043d\u0443 \u041c\u0438\u0445\u0430\u0439\u043b\u043e\u0432\u043d\u0443 \u0437\u0430\u043f\u0438\u0441\u0438 \u0430\u043a\u0442\u043e\u0432 \u043e \u0441\u043c\u0435\u0440\u0442\u0438 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u044e\u0442. \u041f\u0440\u043e\u0432\u0435\u0440\u043a\u0430 \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0434\u0435\u043d\u0430 \u0437\u0430 \u043f\u0435\u0440\u0438\u043e\u0434 \u0441 01.01.1925 \u0433\u043e\u0434\u0430 \u043f\u043e \u043d\u0430\u0441\u0442\u043e\u044f\u0449\u0435\u0435 \u0432\u0440\u0435\u043c\u044f. \u041a\u043d\u0438\u0433\u0438 \u0437\u0430\u043f\u0438\u0441\u0435\u0439 \u0430\u043a\u0442\u043e\u0432 \u0441 1920 \u0433\u043e\u0434\u0430 \u043f\u043e 1925 \u0433\u043e\u0434 \u0445\u0440\u0430\u043d\u044f\u0442\u0441\u044f \u0432 \u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u043c \u0430\u0440\u0445\u0438\u0432\u0435 \u0433. \u0421\u0430\u0440\u0430\u0442\u043e\u0432\u0430.\n</p>\n</div>\n</div>",
